import React from 'react'
import {Typography,AppBar,Button,Card,CardContent,CardMedia,CssBaseline,Grid,Toolbar,Container, CardActions} from '@material-ui/core'


const OfferScreen = () => {
    return (
        <>
          <CardActions>
                <Button size="small" color="primary">View</Button>
                <Button size="small" color="primary">Edit</Button>
              </CardActions>   
        </>
    )
}

export default OfferScreen
